import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './component/common/Navbar.js';
import 'bootstrap/dist/css/bootstrap.min.css';
import Home from './component/pages/Home';
import Customer_Dash from './component/Page/Customer_Dash.js';
import Employee_Dash from './component/Page/Employee_Dash.js';
import Admin_Dash from './component/Page/Admin_Dash.js'
import Registration from './component/Page/Registration.js';
import Transfer from './component/Page/TransferMoney.js'; // Your Transfer Component
import Deposit from './/Page/Deposit.js'; // Your Deposi
import Withdraw from './Page/Withdraw.js'; // Your Withdraw Component
import CheckBalance from './Page/CheckBalance.js'; // Your CheckBalance Component
// import other role pages as needed

function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path='/login' element={<Customer_Dash/>}/>
        <Route path='/register' element={<Registration/>}/>
        <Route path='/employee' element={<Employee_Dash/>}/>
        <Route path='/admin' element={<Admin_Dash/>}/>
        <Route path="/deposit" element={<Deposit />} />
        <Route path="/transfer" element={<Transfer />} />
        <Route path="/withdraw" element={<Withdraw />} />
        <Route path="/check-balance" element={<CheckBalance />} />

      </Routes>
    </Router>
  );
}

export default App;
